INSERT INTO `settings` (`id`, `type`, `name`, `description`, `link`, `image`, `status`, `created_at`, `updated_at`) VALUES
(1, 1, 'About us', 'Welcome to Upcolor App. UpColor is a dynamic gaming platform offering a multi-gaming experience that caters to enthusiasts of all kinds. Whether you enjoy strategic games like Dragon Tiger, thrilling games like Aviator, or fun games like Plinko and Color Prediction, UpColor is your go-to destination for diverse and exciting gameplay. Our mission is to provide an engaging and fair gaming environment where players can compete, have fun, and win rewards. We are committed to continuous innovation, ensuring our platform stays fresh and captivating. Join us on this exciting journey and be a part of our growing community!</p>\n\n<p>UpColor is operates its portal in India, which offers online fantasy sports, E-sports, casual games, and card-based games through the web portal&nbsp;{win4cash.club} and mobile application(s) available on Play Store and app store as well as on our official website (collectively referred to as the &ldquo;portal&rdquo;) (UpColor is a product of UpColor Tech LLPreferred to herein as &ldquo;UpColor&rdquo; or &ldquo;we&rdquo; or &ldquo;us&rdquo; &ldquo;our&rdquo;).</p>\n\n<p>UpColor&nbsp;is considered a &ldquo;game of skill.&rdquo; The game of skills can be defined as a game wherein the skills of the individuals participating in any online e-sports gaming play a dominant role rather than the mere luck of the individuals.</p>\n\n<p>UpColor -&nbsp;respects the privacy of its users and is committed to protecting it in all respects. To offer an enriching and holistic internet experience to its users,&nbsp;UpColor offers a vast repository of amusement facilities. kindly take time to read the &#39;about us&#39; section to learn more about&nbsp;UpColor Most of the amusement facilities are offered for free but you may need registration to participate in&nbsp;UpColor online games.</p>\n\n<p>The information about the user is collected by&nbsp;UpColor  as (i) information supplied by users and (ii) information automatically tracked during the user&#39;s navigation on&nbsp;UpColor </p>\n\n<p>Before you submit any information to the portal, please read this privacy policy for an explanation of how we will treat your personal information. by using any part of the portal, you consent to the collection, use, disclosure, and transfer of your personal information for the purposes outlined in this privacy policy and to the collection, processing, and maintenance of this information. If you do not agree to this Privacy Policy, please do not use the portal. Your use of any part of the portal indicates your acceptance of this privacy policy and the collection, use, and disclosure of your personal information by this Privacy Policy. While you have the option not to provide us with certain information or withdraw consent to collect certain information, kindly note that in such an event you may not be able to take full advantage of the entire scope of features and services offered to you and we reserve the right not to provide you with our services.</p>\n\n<p>Purpose and Usage:<br />\nTo utilize certain services on the Portal, users are required to provide specific information during the registration process.</p>\n\n<p>This information includes-</p>\n\n<p>1. Profile Picture (the image that you upload from your device)&nbsp;<br />\n2. Name&nbsp;<br />\n3. Email address &nbsp;<br />\n4. Date of birth&nbsp;<br />\n5. State<br />\n6. Government ids such as aadhaar card or driver&#39;s license or voter id</p>\n\n<p>Furthermore, to grant you access to the features offered through the Portal, verify your identity, and safeguard your account, we may request your permission to capture and record device-related information, operating system details, network specifics, and location data. Additionally, we may seek your consent to gather information regarding the apps installed on your device. This allows us to enhance our services and improve your overall experience on the Portal. In certain cases, you may also be required to provide additional information, such as your Permanent Account Number (PAN).</p>\n\n<p>In specific instances, we may collect sensitive personal information (SPI) from you on the Portal. SPI refers to personal information that pertains to your financial details, such as the payment instrument or mode used for transactions. The collection of such SPI is solely to facilitate prompt and secure payments.</p>\n\n<p>It is important to note that aside from the financial information provided during payment for services on the&nbsp;&nbsp;UpColor&nbsp;does not collect any other SPI while delivering the services. Any SPI collected by&nbsp;UpColor will not be disclosed to any third-party service providers without your explicit consent, except as otherwise stated in this Privacy Policy or as required by law. This condition does not apply to publicly available information, including SPI related to you on the Portal.</p>\n\n<p>We collect and utilize personal information (i.e., information that can be used to identify you and is not publicly available) to operate, provide, develop, and enhance the services we offer. This includes keeping you informed about our offerings, as well as the products and services provided by our affiliates and group entities. Additionally, we may share this information with our affiliates and group entities, who may contact you regarding their products and services.</p>\n\n<p>While using the services, users may invite other existing users or new users (referred to as &quot;Invited Users&quot;) to participate in the services through various social media platforms such as Facebook, WhatsApp, Instagram, etc. The information provided for this purpose may be used to contact and invite the Invited Users to register with&nbsp;UpColor and participate in the relevant game. The participation of Invited Users in any game is subject to the terms outlined in this Privacy Policy and the Terms and Conditions for using the Portal. By inviting others, you confirm that the Invited Users have consented to and agreed with the disclosure of their information to us, our affiliates, and/or our group entities. Additionally, you may choose to invite your friends by synchronizing your phonebook and directly inviting them from the Portal to play the game and utilize the services.</p>\n\n<p>All the required information is specific to the type of game or services the user wishes to participate in or access. It will be utilized solely to provide the requested services and ensure a seamless user experience.</p>\n\n<p>Disclosure/Sharing:<br />\nUpColor&nbsp;may share the information provided by you and data concerning your usage of the Services and participation in the Games with its affiliates and group entities. This sharing is intended to enable UpColor&rsquo;s affiliates and group entities to contact you regarding the products and services they offer. Additionally,&nbsp;UpColor may share such information with third-party service providers engaged by&nbsp;UpColor for purposes such as data analytics, storage, service improvements (including product enhancements), and to enhance your overall experience with UpColor. Any affiliate, group entity, or third-party service provider with whom the information is shared will be required to maintain the same standards as&nbsp;UpColor in terms of information security to the best of their abilities.</p>\n\n<p>By using the Portal, you explicitly agree and grant consent to the collection, use, and storage of your information by&nbsp;UpColor reserves the right to share, disclose, and transfer the information collected, including personal information, with its affiliates and group entities. If&nbsp;UpColor sells or transfers all or a portion of its business assets, consumer information may be shared, disclosed, or transferred as part of the transaction. Therefore, you expressly grant consent and permission to&nbsp;UpColor for the disclosure and transfer of personal information to such third parties.</p>\n\n<p>UpColor&nbsp;may share information and data regarding the usage of the Services and participation in the Game with its commercial partners to facilitate user engagement, marketing and promotional activities, and other related purposes. Furthermore,&nbsp;UpColor reserves the right to disclose or share information with affiliates, group entities, and third parties in limited circumstances. These circumstances include complying with applicable laws, responding to duly authorized legal processes or governmental requests, preventing fraud or imminent harm, and ensuring the security of our network and services.</p>\n\n<p>Use of cookies:<br />\nTo improve the effectiveness and usability of the portal for our users, we use &quot;cookies&quot;, or such similar electronic tools to collect information to assign each visitor a unique random number as a User Identification (User ID) to understand the User&#39;s interests using the identified computer. Unless the user voluntarily identifies himself/herself (e.g., through registration),&nbsp;UpColor has no way of knowing who the User is, even if we assign a cookie to the User&#39;s computer. The only personal information a cookie can contain is information supplied by the User. a cookie cannot read data off the user&#39;s hard drive.&nbsp;UpColor advertisers may also assign their cookies to the user&#39;s browser (if the User clicks on their ad banners), a process that&nbsp;UpColor does not control.</p>\n\n<p>UpColor&nbsp;web servers automatically collect limited information about a user&#39;s computer&#39;s connection to the internet, including the user&#39;s IP address, when the user visits the Portal. (The user&#39;s IP address is a number that lets computers attached to the Internet know where to send data to the User -- such as the web pages viewed by the User). The User&#39;s IP address does not identify the User personally.&nbsp;UpColor uses this information to deliver its web pages to Users upon request, to tailor its Portal to the interests of its users, to measure traffic within the Portal, and to let advertisers know the geographic locations from where&nbsp;UpColor visitors come.</p>\n\n<p>Links:<br />\nUpColor&nbsp;also includes links to other websites. such websites are governed by their respective privacy policies, which are beyond UpColor&#39;s control. Once the User leaves&nbsp;UpColor servers (the User can tell where he/she is by checking the URL in the location bar on the User&#39;s browser), the use of any information provided by the User is governed by the privacy policy of the operator of the site which the User is visiting. That policy may differ from UpColor&#39;s own. If the user can&#39;t find the privacy policy of any of these sites via a link from the site&#39;s homepage, the user may contact the site directly for more information.&nbsp;UpColor is not responsible for the privacy practices or the content of such websites.</p>\n\n<p>Security procedures:<br />\nAll information gathered on&nbsp;UpColor has been securely stored within UpColor-controlled databases. The database is stored on servers secured behind a firewall; access to such servers is password-protected and strictly limited based on a need-to-know basis. However, we understand that as effective as our security measures are, no security system is impenetrable. Thus, we cannot guarantee the security of our database, nor can we guarantee that the information you supply will not be intercepted while being transmitted to us over the Internet. Further, any information you include in a posting to the discussion areas will be available to anyone with internet access. By using the portal, you understand and agree that your information may be used in or transferred to countries other than India.</p>\n\n<p>UpColor&nbsp;also believes that the internet is an ever-evolving medium. We may periodically review from time to time and change our privacy policy to incorporate such future changes as may be considered appropriate, without any notice to you. Our use of any information we gather will always be consistent with the policy under which the information was collected, regardless of what the new policy may be. Any changes to our privacy policy will be posted on this page, so you are always aware of what information we collect, how we use it, how we store it, and under what circumstances we disclose it.</p>\n\n<p>Advertising:<br />\nWhen&nbsp;UpColor presents information to its online advertisers -- to help them understand our audience and confirm the value of advertising on the portal -- it is usually in the form of aggregated statistics on traffic to various pages within our site. When you register with UpColor, we contact you from time to time about updating your content to provide features that we believe may benefit you. By registering on our portal, you agree to receive all communications from us including promotional messages relating to tournaments, contests, leagues &amp; bonuses through SMS, voice call, email &amp; push notifications.</p>\n\n<p>Disclaimer:<br />\nThere are deceptive emails, websites, blogs, and other online communications circulating on the internet that falsely claim to be associated with or from&nbsp;UpColor These deceptive communications may feature our logo, photos, links, content, or other information. Some of them may even contact users directly, asking for login credentials, passwords, or personal information. They may also falsely inform users that they have won a prize or offer a method to engage in illegal or unauthorized activities. We want to clarify that these deceptive communications and their accompanying materials are in no way associated with&nbsp;UpColor To ensure your safety, we strongly advise against responding to such deceptive communications. Please be aware that we will not be held responsible for any loss, damage, or harm that you may experience as a result of relying on or acting upon such deceptive communications.</p>\n\n<p>Please note that unless it is necessary for verification purposes as outlined in the Terms and Conditions, we and our employees will not contact you to request your sensitive personal information (SPI).</p>\n\n<p>Conditions of use:<br />\nUpColor&nbsp;does not warrant that this portal, its servers, or emails sent by us or on our behalf are virus-free.&nbsp;UpColor will not be liable for any damages of any kind arising from the use of this portal, including, but not limited to compensatory, direct, indirect, incidental, punitive, special, and consequential damages, loss of data, goodwill, business opportunity, income or profit, loss of or damage to property and claims of third parties. In no event will&nbsp;UpColor be liable for any damages whatsoever in an amount over INR 100.</p>\n\n<p>User Account and Data Deletion:<br />\nUsers have the right to request the deletion of their user accounts and personal information from UpColor. To initiate this process, users can send a written request via email to&nbsp;info@UpColor.app</p>\n\n<p>We strive to respond to such requests promptly, within 60 days from either receiving the written request or any additional information requested to fulfill the request, whichever is later.</p>\n\n<p>&gt;In addition to account deletion, users also have the option to request suspension or temporary deactivation of their accounts by contacting&nbsp;info@UpColor.app</p>\n\n<p>&gt;With the suspension option, users will be unable to participate in paid contests on their user accounts but will retain access to other parts of the Portal. Alternatively, temporary deactivation prevents login access to the Portal but allows users to reactivate their accounts along with all associated data.</p>\n\n<p>&gt;If a user chooses to permanently deactivate their account, they will lose access to the Portal and its services, including any user data and personal information linked to their account. However, users may request account restoration within six (6) months from the date of receiving the account deletion notification from&nbsp;UpColor by contacting&nbsp;info@UpColor.app</p>\n\n<p>&gt;When a data deletion request is made, we follow a secure deletion process to ensure that the data is completely removed from our servers or retained only in anonymized form. We take precautions to protect information from accidental or malicious deletion. However, please note that there may be slight delays between the deletion request and the removal of data from both our active systems and backup systems.</p>\n\n<p>Applicable law and jurisdiction:<br />\nBy visiting this portal, you agree that the laws of the republic of india without regard to its conflict of laws principles, govern this privacy policy and any dispute arising in respect hereof shall be subject to and governed by the dispute resolution process set out in the&nbsp;terms and conditions.</p>\n\n<p>Updating information:<br />\nYou will promptly notify&nbsp;UpColor if there are any changes, updates or modifications to your information. further, you may also review, update or modify your information and user preferences by logging into your profile page on the portal.</p>\n\n<p>Contact us:<br />\nAny questions or clarifications with respect to this Policy or any complaints, comments, concerns or feedback can be sent to&nbsp;UpColor at: info@UpColor.app or by normal/physical mail addressed to:</p>\n\n<p>Attn: UpColor Team&nbsp;</p>\nThanks', '', NULL, 1, NULL, NULL),
(2, 2, 'Terms and Conditions (TnC)\n', '<p><strong>1. Introduction</strong></p>\n\n<p>Welcome to UpColor! By accessing or using our platform, you agree to comply with and be bound by these Terms and Conditions (&quot;Terms&quot;). If you do not agree, please do not use our platform.</p>\n\n<p><strong>2. Account Registration and Security</strong></p>\n\n<ul>\n	<li>Eligibility: Must be 18+.</li>\n	<li>Account Creation: Provide accurate information.</li>\n	<li>Account Security: Notify us of unauthorized use.o</li>\n</ul>\n\n<p><strong>3. User Conduct</strong></p>\n\n<ul>\n	<li>Prohibited Activities: No unlawful activities or harmful behavior.</li>\n	<li>User Content: Grant us a license to use your submitted content.</li>\n</ul>\n\n<p><strong>4. Intellectual Property</strong></p>\n\n<ul>\n	<li>Ownership: All platform content belongs to UpColor.</li>\n	<li>License: Limited, non-transferable license for personal use.</li>\n</ul>\n\n<p><strong>5. Payments and Refunds</strong></p>\n\n<ul>\n	<li>In-App Purchases: Final and non-refundable.</li>\n	<li>Payment Methods: Provide valid payment methods.</li>\n	<li>Refund Policy: No refunds, except as required by law.</li>\n</ul>\n\n<p><strong>6. Termination</strong></p>\n\n<ul>\n	<li>By UpColor: We can suspend or terminate accounts.</li>\n	<li>Effect of Termination: Rights to use cease immediately.</li>\n</ul>\n\n<p><strong>7. Disclaimers and Limitation of Liability</strong></p>\n\n<ul>\n	<li>No Warranties: Platform provided &quot;as is.&quot;</li>\n	<li>Limitation of Liability: Not liable for indirect damages.</li>\n</ul>\n\n<p><strong>8. Governing Law and Dispute Resolution</strong></p>\n\n<ul>\n	<li>Governing Law: Local jurisdiction laws apply.</li>\n	<li>Dispute Resolution: Binding arbitration for disputes.</li>\n</ul>\n\n<p><strong>9. Changes to Terms</strong></p>\n\n<ul>\n	<li>We may modify these Terms. Continued use means acceptance of changes.</li>\n</ul>\n\n<p><strong>10. Contact Information</strong></p>\n\n<ul>\n	<li>Email: help.UpColor@gmail.com</li>\n	<li>https://t.me/UpColor_official</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p><em>By using UpColor, you agree to these Terms and Conditions.</em></p>', '', NULL, 1, NULL, NULL),
(4, 3, ' Beginners Guide\n', '<p><strong>Welcome to UpColor: A Beginner&rsquo;s Guide</strong></p>\n\n<p>&nbsp;</p>\n\n<p><strong>1. Getting Started</strong></p>\n\n<p>&nbsp;&nbsp;&nbsp;Sign Up: Create your account with your email or social media.</p>\n\n<p>&nbsp;&nbsp;&nbsp;Profile Setup: Customize your profile with an avatar and username.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>2. Exploring Games</strong></p>\n\n<ul>\n	<li>&nbsp;&nbsp;&nbsp;Aviator: Predict the flight distance of the aviator and win rewards.</li>\n	<li>&nbsp;&nbsp;&nbsp;Color Prediction: Guess the correct color in a series of options.</li>\n	<li>&nbsp;&nbsp;&nbsp;Plinko: Drop the ball and win based on where it lands.</li>\n	<li>&nbsp;&nbsp;&nbsp;Dragon Tiger: Bet on which card (Dragon or Tiger) will be higher.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p><strong>3. In-Game Currency</strong></p>\n\n<ul>\n	<li>&nbsp;&nbsp;&nbsp;Purchase coins to play games and enter tournaments.</li>\n	<li>&nbsp;&nbsp;&nbsp;Earn rewards through daily login bonuses and challenges.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p><strong>4. Safety and Fair Play</strong></p>\n\n<ul>\n	<li>&nbsp;&nbsp;&nbsp;We use advanced algorithms to ensure fair play.</li>\n	<li>&nbsp;&nbsp;&nbsp;Report any suspicious activity to our support team.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p><strong>5. Community and Support</strong></p>\n\n<ul>\n	<li>&nbsp;&nbsp;&nbsp;Join our forums to discuss strategies and meet other players.</li>\n	<li>&nbsp;&nbsp;&nbsp;Contact our support team for any issues or questions.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p><em>Welcome to the UpColor community! Have fun and good luck!</em></p>', '', NULL, 1, NULL, NULL),
(5, 4, 'Invitation Rules\r\n', '<p><strong>UpColor Invitation Rules</strong></p>\n\n<p>&nbsp;</p>\n\n<p><strong>1. Eligibility:</strong></p>\n\n<p>&nbsp;&nbsp;&nbsp;- Only registered users can send invitations.</p>\n\n<p>&nbsp;&nbsp;&nbsp;- Invite friends who are 18 years or older.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>2. Invitation Process:</strong></p>\n\n<p>&nbsp;&nbsp;&nbsp;- Use the unique invitation link found in your profile.</p>\n\n<p>&nbsp;&nbsp;&nbsp;- Share via email, social media, or direct message.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>3. Rewards:</strong></p>\n\n<p>&nbsp;&nbsp;&nbsp;- Earn rewards for each successful referral who registers and plays.</p>\n\n<p>&nbsp;&nbsp;&nbsp;- Both the inviter and the invitee receive bonus coins.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>4. Fair Use:</strong></p>\n\n<p>&nbsp;&nbsp;&nbsp;- Do not spam or misuse the invitation system.</p>\n\n<p>&nbsp;&nbsp;&nbsp;- Invitations must be to genuine friends or contacts.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>5. Monitoring and Abuse:</strong></p>\n\n<p>&nbsp;&nbsp;&nbsp;- We monitor invitation activity.</p>\n\n<p>&nbsp;&nbsp;&nbsp;- Misuse can result in suspension of invitation privileges.</p>\n\n<p>&nbsp;</p>\n\n<p><em>Invite your friends and enjoy the UpColor experience together!</em></p>\n\n<p>&nbsp;</p>', '', NULL, 1, NULL, NULL),
(6, 5, 'Confidentiality Agreement', '<p><strong>UpColor Confidentiality Agreement</strong></p>\n\n<p>This Confidentiality Agreement (&ldquo;Agreement&rdquo;) is entered into by and between [Your Name], the &quot;Recipient,&quot; and UpColor Games, the &quot;Disclosing Party.&quot;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>1. Definition of Confidential Information:</strong></p>\n\n<ul>\n	<li>Includes all non-public information disclosed, such as trade secrets, business plans, and user data.</li>\n</ul>\n\n<p><strong>2. Obligations of Recipient:</strong></p>\n\n<ul>\n	<li>Maintain the confidentiality of the information.</li>\n	<li>Do not disclose to third parties without written consent.</li>\n	<li>Use information solely for the purpose it was provided.</li>\n</ul>\n\n<p><strong>3. Exceptions:</strong></p>\n\n<ul>\n	<li>Information already known to the recipient.</li>\n	<li>Information that becomes public through no fault of the recipient.</li>\n	<li>Information independently developed or obtained by the recipient.</li>\n</ul>\n\n<p><strong>4. Term:</strong></p>\n\n<ul>\n	<li>This Agreement is effective as of the date signed and remains in effect until the confidential information no longer qualifies as confidential or five years, whichever is longer.</li>\n</ul>\n\n<p><strong>5. Miscellaneous:</strong></p>\n\n<ul>\n	<li>Governing Law: [Specify jurisdiction].</li>\n	<li>Amendments: Must be in writing and signed by both parties.</li>\n</ul>\n\n<p>By signing below, both parties agree to the terms of this Confidentiality Agreement.</p>\n\n<p>&nbsp;</p>\n\n<p>Signature: _______ &nbsp; &nbsp; &nbsp; Date: ______</p>\n\n<p>Recipient: _______</p>', '', NULL, 1, NULL, NULL),
(7, 6, 'Risk Disclosure Agreement', '<p><strong>UpColor Risk Disclosure Agreement</strong></p>\n\n<p>&nbsp;</p>\n\n<p><strong>1. General Risk Acknowledgment:</strong></p>\n\n<ul>\n	<li>Participation in games on UpColor involves financial risk.</li>\n	<li>You may lose some or all of your money while playing games.</li>\n</ul>\n\n<p><strong>2. No Guarantees:</strong></p>\n\n<ul>\n	<li>UpColor does not guarantee profits or winnings.</li>\n	<li>Outcomes of games are determined by algorithms and/or chance.</li>\n</ul>\n\n<p><strong>3. User Responsibility:</strong></p>\n\n<ul>\n	<li>You are responsible for all decisions made on the platform.</li>\n	<li>Only play with money you can afford to lose.</li>\n</ul>\n\n<p><strong>4. No Liability:</strong></p>\n\n<ul>\n	<li>UpColor is not responsible for any losses incurred.</li>\n	<li>We do not provide financial advice or recommendations.</li>\n</ul>\n\n<p><strong>5. Compliance with Laws:</strong></p>\n\n<ul>\n	<li>Ensure your use of UpColor complies with local laws.</li>\n	<li>It is your responsibility to know and understand the legalities in your jurisdiction.</li>\n</ul>\n\n<p><strong>6. Changes to Risks:</strong></p>\n\n<ul>\n	<li>UpColor may update this Risk Disclosure Agreement as needed.</li>\n	<li>Continued use of the platform constitutes acceptance of any changes.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>By using UpColor, you acknowledge that you have read and understand this Risk Disclosure Agreement and accept the risks involved.</p>', '', NULL, 1, NULL, NULL),
(8, 7, 'Upcolor FAQs', '<p><strong>UpColor FAQs</strong></p>\n\n<p><strong>1. What is UpColor?</strong></p>\n\n<p>UpColor is a multi-gaming platform offering a variety of exciting games, including Aviator, Color Prediction, Plinko, and Dragon Tiger. Our platform provides a thrilling and fair gaming experience with numerous rewards and bonuses.</p>\n\n<p><strong>2. How do I sign up for UpColor?</strong></p>\n\n<p>Signing up is easy! Click on the &quot;Sign Up&quot; button on our homepage, fill in your details, and create your account. You can also sign up using your social media accounts for quicker access.</p>\n\n<p><strong>3. Is UpColor free to use?</strong></p>\n\n<p>Yes, creating an account and exploring the platform is free. However, some games and features may require in-app purchases or virtual currency.</p>\n\n<p><strong>4. How do I play the games on UpColor?</strong></p>\n\n<p>Each game has its own set of rules and instructions. You can find detailed guides within the platform by selecting the game you&rsquo;re interested in. Our Beginner&rsquo;s Guide is also a great resource to get started.</p>\n\n<p><strong>5. What rewards can I earn on UpColor?</strong></p>\n\n<p>You can earn virtual coins, bonuses, and exclusive prizes by playing games, participating in daily challenges, and inviting friends to join UpColor.</p>\n\n<p><strong>6. How do I invite friends to UpColor?</strong></p>\n\n<p>You can invite friends by sharing your unique invitation link found in your profile. Both you and your friend will receive bonus rewards when they sign up and start playing.</p>\n\n<p><strong>7. Are the games on UpColor fair?</strong></p>\n\n<p>Yes, we use advanced algorithms and random number generators to ensure that all games are fair and transparent. Our priority is to provide a secure and trustworthy gaming environment.</p>\n\n<p><strong>8. How can I purchase virtual currency?</strong></p>\n\n<p>You can purchase virtual currency through our in-app store using various payment methods, including credit/debit cards, PayPal, and more. Check the &quot;Shop&quot; section within the platform for more details.</p>\n\n<p><strong>9. What should I do if I encounter an issue with the platform?</strong></p>\n\n<p>If you experience any issues, please contact our support team via email at support@UpColor.com or use the live chat feature on our website. We are available 24/7 to assist you.</p>\n\n<p><strong>10. How is my personal information protected?</strong></p>\n\n<p>We take your privacy seriously. UpColor uses industry-standard encryption and security measures to protect your personal information. For more details, please read our Privacy Policy.</p>\n\n<p><strong>11. Can I close my UpColor account?</strong></p>\n\n<p>Yes, if you wish to close your account, please contact our support team. Keep in mind that closing your account is permanent, and you will lose access to all your progress and rewards.</p>\n\n<p><strong>12. How do I stay updated with UpColor&rsquo;s latest news and promotions?</strong></p>\n\n<p>Follow us on our social media channels (Facebook, Twitter, Instagram) and subscribe to our newsletter to stay updated on the latest news, promotions, and events.</p>\n\n<p><strong>13. Is there an age requirement to use UpColor?</strong></p>\n\n<p>Yes, you must be at least 18 years old to create an account and use the UpColor platform.</p>\n\n<p><strong>14. How do I update my account information?</strong></p>\n\n<p>You can update your account information by going to your profile settings within the platform. Make sure to save any changes you make.</p>\n\n<p><strong>15. Are there any community guidelines I should follow?</strong></p>\n\n<p>Yes, we have community guidelines to ensure a positive and respectful environment for all players. Please refer to our Terms and Conditions for detailed information on acceptable behavior.</p>\n\n<p><strong>16. What if I forget my password?</strong></p>\n\n<p>If you forget your password, click on the &quot;Forgot Password&quot; link on the login page and follow the instructions to reset it.</p>\n\n<p><strong>17. How do I report a bug or provide feedback?</strong></p>\n\n<p>We appreciate your feedback! You can report bugs or provide feedback by contacting our support team or using the feedback form available on the platform.</p>\n\n<p><strong>18. What happens if my account is suspended?</strong></p>\n\n<p>If your account is suspended, you will receive an email explaining the reason. Please contact our support team for further assistance and to resolve the issue.</p>\n\n<p>&nbsp;</p>\n\n<p><em>If you have any other questions or need further assistance, please don&#39;t hesitate to reach out to our support team. We&#39;re here to help you enjoy your UpColor experience to the fullest!</em></p>\n\n<p>&nbsp;</p>', '', NULL, 1, NULL, NULL),
(9, 8, 'Upcolor Game Rule', '<p>1 minutes 1 issue, 55 seconds to order, 5 seconds waiting for the draw. It opens all day. The total number of trade is 1440 issues.</p>\n  <p>If you spend 100 to trade, after deducting service fee 2%, contract amount : 98</p>\n  <ol>\n    <li>Select green: if the result shows 1,3,7,9 you will get (98*2)=196;If the result shows 5, you will get (98*1.5) 147</li>\n    <li>Select red: if the result shows 2,4,6,8 you will get</li>\n    <li>Select violet: if the result shows 0 or 5, you will get</li>\n    <li>Select number: if the result is the same as the number you selected, you will get</li>\n    <li>Select big: if the result shows 5,6,7,8,9 you will get</li>\n    <li>Select small: if the result shows 0,1,2,3,4 you will get</li>\n  </ol>', '', NULL, 1, NULL, NULL);
INSERT INTO `settings` (`id`, `type`, `name`, `description`, `link`, `image`, `status`, `created_at`, `updated_at`) VALUES
(10, 9, 'trx game rule', '<div data-v-73484f00=\"\" class=\"TimeLeft__C-PreSale-body\">\n    <div data-v-73484f00=\"\">\n        <p class=\"MsoNormal\">\n            <font face=\"Verdana\">\n                <font style=\"vertical-align: inherit;\">\n                    <font style=\"vertical-align: inherit;\">\n                        <font style=\"vertical-align: inherit;\">\n                            <font style=\"vertical-align: inherit;\">\n                                <font style=\"vertical-align: inherit;\">\n                                    <font style=\"vertical-align: inherit;\">\n                                        <font style=\"vertical-align: inherit;\">\n                                            <font style=\"vertical-align: inherit;\">\n                                                <font style=\"vertical-align: inherit;\">\n                                                    <font style=\"vertical-align: inherit;\">\n                                                        <font style=\"vertical-align: inherit;\">\n                                                            <font style=\"vertical-align: inherit;\">What is a hash value?\n                                                            </font>\n                                                        </font>\n                                                    </font>\n                                                </font>\n                                            </font>\n                                        </font>\n                                    </font>\n                                </font>\n                            </font>\n                        </font>\n                    </font>\n                </font>\n            </font>\n        </p>\n        <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\">\n                <font style=\"vertical-align: inherit;\">\n                    <font style=\"vertical-align: inherit;\">\n                        <font style=\"vertical-align: inherit;\">\n                            <font style=\"vertical-align: inherit;\">\n                                <font style=\"vertical-align: inherit;\">\n                                    <font style=\"vertical-align: inherit;\">Anyone who knows the basics of Bitcoin will\n                                        be exposed to a concept, a hash value. Bitcoin\'s block header has a hash of the\n                                        previous block in it, which is used to point to the previous block.</font>\n                                </font>\n                            </font>\n                        </font>\n                    </font>\n                </font>\n            </span><br></p>\n        <p class=\"MsoNormal\">\n            <font face=\"Verdana\"><br></font>\n        </p>\n        <p class=\"MsoNormal\">\n            <font face=\"Verdana\">\n                <font style=\"vertical-align: inherit;\">\n                    <font style=\"vertical-align: inherit;\">\n                        <font style=\"vertical-align: inherit;\">\n                            <font style=\"vertical-align: inherit;\">\n                                <font style=\"vertical-align: inherit;\">\n                                    <font style=\"vertical-align: inherit;\">\n                                        <font style=\"vertical-align: inherit;\">\n                                            <font style=\"vertical-align: inherit;\">\n                                                <font style=\"vertical-align: inherit;\">\n                                                    <font style=\"vertical-align: inherit;\">\n                                                        <font style=\"vertical-align: inherit;\">\n                                                            <font style=\"vertical-align: inherit;\">Hash is the\n                                                                transliteration of English hash, we can also translate\n                                                                it into hash, so hash value is also called hash value. A\n                                                                hash value is a value calculated with a hash function\n                                                                (or hash function/hash algorithm). To understand hash\n                                                                values, one must understand the nature of hash\n                                                                functions. A hash function can computationally transform\n                                                                an input of arbitrary length into an output of fixed\n                                                                length.</font>\n                                                        </font>\n                                                    </font>\n                                                </font>\n                                            </font>\n                                        </font>\n                                    </font>\n                                </font>\n                            </font>\n                        </font>\n                    </font>\n                </font>\n            </font>\n        </p>\n        <p class=\"MsoNormal\">\n            <font face=\"Verdana\"><br></font>\n        </p>\n        <p class=\"MsoNormal\">\n            <font face=\"Verdana\">\n                <font style=\"vertical-align: inherit;\">\n                    <font style=\"vertical-align: inherit;\">\n                        <font style=\"vertical-align: inherit;\">\n                            <font style=\"vertical-align: inherit;\">\n                                <font style=\"vertical-align: inherit;\">\n                                    <font style=\"vertical-align: inherit;\">\n                                        <font style=\"vertical-align: inherit;\">\n                                            <font style=\"vertical-align: inherit;\">\n                                                <font style=\"vertical-align: inherit;\">\n                                                    <font style=\"vertical-align: inherit;\">\n                                                        <font style=\"vertical-align: inherit;\">\n                                                            <font style=\"vertical-align: inherit;\">Every hash function\n                                                                has the property that if the input value is the same,\n                                                                the output hash value is the same. If the input values\n                                                                &ZeroWidthSpace;&ZeroWidthSpace;&ZeroWidthSpace;&ZeroWidthSpace;&ZeroWidthSpace;&ZeroWidthSpace;&ZeroWidthSpace;&ZeroWidthSpace;&ZeroWidthSpace;&ZeroWidthSpace;&ZeroWidthSpace;&ZeroWidthSpace;are\n                                                                different, the output hashes are usually different, but\n                                                                there is a very small chance of a hash collision . If a\n                                                                hash collision is ruled out with a slight change in the\n                                                                input value, a completely unrelated hash value is\n                                                                output. Since the hash function is irreversible and easy\n                                                                to verify, it is almost impossible to reverse the input\n                                                                value through the output hash value. If there is an\n                                                                input value, the corresponding hash value can be\n                                                           